import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class FoodService {

  constructor() { }
  getAll() : String[]{
    return[
      '/assets/f1.jpg',
      '/assets/f2.jpg',
      '/assets/f3.jpg',
      '/assets/f3.jpg',
    ]
  }
}
